import React from "react";
import styled from "styled-components";

import homeBg from "../Assets/homeBg.jpg";
const HomePage = () => {
  return (
    <Wrapper>
      <img className="homeBg" src={homeBg} alt="interior design"></img>
    </Wrapper>
  );
};

export default HomePage;
